import '../styles/contact.css'

export default function Contact() {
    return (
        <div className='contact-content'>
            <a href='mailto:mail@blythehammett.com'>
                <h1 className='poppins-bold'>Keep in <span className='gradient'>touch</span> ✉️</h1>
            </a>
        </div>
    )
}
